import React, { useState } from "react";
import "./searchPage.css";
import NavBar from "./navBar";
import SearchBar from "./searchBar";
import Header from "./header";

const SearchPage = () => {
  const [state, setState] = useState({
    searchValue: "sushi"
  });

  return (
    <div>
      <Header />
      <NavBar />
      <SearchBar />
    </div>
  );
};

export default App;
